import JournalForm from '../components/journalForm'
import ShowJournal from '../components/seeJournals'


export class Journal extends Component {
  render() {
    return (
    <div className="App">
        <JournalForm />
        <ShowJournal />
    </div>
  );
  }
}

export default Journal;
